import React from "react";
import styled from "styled-components";

const ProfileDetailLi = styled.li`
  font-size: 16px;
  font-weight: 400;
  margin-right: 40px;
  list-style-type: none;
  @media only screen and (max-width: 735px) {
    font-size: 14px;
    font-weight: 400;
    color: rgb(142, 142, 142);
    line-height: 18px;
    text-align: center;
    margin-right: 0;
  }
`;
const ProfileDetailSpan = styled.span`
  font-weight: 600;
  @media only screen and (max-width: 735px) {
    font-weight: 600;
    color: var(--ins-content-primary);
    display: block;
  }
`;

export function KeyNumber(props) {

  return (
    <ProfileDetailLi>
      <ProfileDetailSpan>{props.number}</ProfileDetailSpan> {props.label}
      {/*Modal popup following*/}
      <Modal
        open={opening}
        onClose={handleCloseIng}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
      >
        <Box sx={styleLike}>
          <List
            sx={{
              width: "100%",
              maxWidth: 360,
              bgcolor: "background.paper",
              position: "relative",
              overflow: "auto",
              maxHeight: 300,
              "& ul": { padding: 0 },
            }}
            subheader={<li />}
          >
            <li key={`likedby`}>
              <ul>
                <ListSubheader>{`Liked By`}</ListSubheader>
                {following?.users?.map((user) => {
                  return (
                    <Profile
                      iconSize="medium"
                      storyBorder={true}
                      username={user.followee.name}
                      image={user.followee.image}
                      id_user={user.followee.id_user}
                    />
                  );
                })}
              </ul>
            </li>
          </List>
        </Box>
      </Modal>
      {/*Modal popup follower*/}
      <Modal
        open={opener}
        onClose={handleCloseEr}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
      >
        <Box sx={styleLike}>
          <List
            sx={{
              width: "100%",
              maxWidth: 360,
              bgcolor: "background.paper",
              position: "relative",
              overflow: "auto",
              maxHeight: 300,
              "& ul": { padding: 0 },
            }}
            subheader={<li />}
          >
            <li key={`likedby`}>
              <ul>
                <ListSubheader>{`Liked By`}</ListSubheader>
                {follower?.users?.map((user) => {
                  return (
                    <Profile
                      iconSize="medium"
                      storyBorder={true}
                      username={user.follower.name}
                      image={user.follower.image}
                      id_user={user.follower.id_user}
                    />
                  );
                })}
              </ul>
            </li>
          </List>
        </Box>
      </Modal>
    </ProfileDetailLi>
  );
}

KeyNumber.defaultProps = {
  number: "722",
  label: "posts"
};
